import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./pages/Home";
import AddRota from "./pages/AddRota";
import ConsultaRotas from "./pages/ConsultaRotas";

function App() {
  return (
    <Router>
      <div>
        <nav style={{ backgroundColor: "#2c3e50", padding: "1rem" }}>
          <Link to="/" style={{ color: "white", marginRight: "1rem" }}>
            Home
          </Link>
          <Link to="/adicionar-rota" style={{ color: "white", marginRight: "1rem" }}>
            Adicionar Rota
          </Link>
          <Link to="/consulta-rotas" style={{ color: "white" }}>
            Consulta de Rotas
          </Link>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/adicionar-rota" element={<AddRota />} />
          <Route path="/consulta-rotas" element={<ConsultaRotas />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
